import React from 'react';
import './storelist.css'


const StoreList = (props) => {
return(
    <div className='custom'>
            <h1 className='head' style={{fontSize: 90}}>Stall List</h1>
            <div className='row'>
            <div className='container' onClick={() => props.history.push('/stalldisplay')}>
                <h1 style={{textAlign: 'center', alignContent: 'center'}}>Stall 1</h1>
            </div>
            <div className='container'></div>
            </div>
    
    </div>
);
}

export default StoreList
